import React, { Component } from 'react';
import ToDoItems from './ToDoItems'
class Todo extends Component {
    render() { 
        console.log(this.props.Todo)
        return (
            this.props.todolist.map((todo) => (
                <ToDoItems todolist = {todo.id}/>
            ))
            );
    }
}

export default Todo;
